import React, { Component } from 'react';

class AboutUs extends Component {
    render() {
        return (
            <div id="main">
				<div id="content">
					<section>
						<div className="container">
							<h3>About Us</h3>
						</div>
					</section>
				</div>
			</div>
        );
    }
}

export default AboutUs;
